import React from "react";
import { Route, Routes } from "react-router-dom";
import Map from "./Map";

export default function Home() {
  return (
    <React.Fragment>
      <Routes>
        <Route exact path="/" component={Home} />
        <Route path="/map" component={Map} />
      </Routes>
    </React.Fragment>
  )
}
